import '../css/Card.css';
import React, { useState } from "react";


function Card() {
  return (
    <NavLink
    to="/details"
    exact
    >    
        <div class="container">
            <img src="../assets/us.jpg" alt="Mandolin" />
            <h1>Mandolin</h1>
            <p>Mandolin that is lightly used, solid construction.</p>
            <span>Price: $40</span>
        </div>
    </NavLink>

  );
}

export default Card;
